<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta content="telephone=no" name="format-detection" />
  <link rel="icon" href="<%= BASE_URL %>favicon.ico">
  <% if (process.env.NODE_ENV !== 'development') { %>

  <% for(var css of htmlWebpackPlugin.options.cdn.css) { %>
  <link href="<%=css%>" rel="preload" as="style">
  <link rel="stylesheet" href="<%=css%>" as="style">
  <% } %>
  <% for(var js of htmlWebpackPlugin.options.cdn.js) { %>
  <link href="<%=js%>" rel="preload" as="script">
  <script src="<%=js%>"></script>
  <% } %>
  <% } %>
  <link href="https://cdn.myun.info/jsencrypt.min.js" rel="preload" as="script">
  <script src="https://cdn.myun.info/jsencrypt.min.js"></script>
  <title>vue-cli3-project</title>
</head>

<body>
  <noscript>
    <strong>We're sorry but vue-cli3-project doesn't work properly without JavaScript enabled. Please enable it to
      continue.</strong>
  </noscript>
  <div id="app"></div>
  <!-- built files will be auto injected -->
</body>

</html>
